import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    listings = [""];
    buffer = "";

    componentDidMount()
    {
        var arr;

        fetch(raw)
            .then(r => r.text())
            .then(text => {
                this.buffer = text;
                
            });
        console.log('buffer is ', this.buffer);
        arr = buffer.split('\n');
        console.log('array is', arr);
        this.listings = arr;
        console.log('listings is', this.listings);
        console.log('listings2 is', this.listings);

    }

    render()
    {
        return (

            <ul>
                {
                    this.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
